import React from "react";
import { AppBar, Toolbar, Typography, Box, Button } from '@mui/material';

const Header = () => {
    return (
        <AppBar sx={{background:"radial-gradient(circle, rgba(238,174,202,1) 0%, rgba(148,148,233,1) 100%);"}}>
            <Toolbar>
                <Typography variant="h4">Blog App</Typography>
                <Box display="flex" marginLeft="auto">
                    <Button variant='contained' sx={{margin:'2', borderRadius: 10}} color="warning">Login</Button>
                    <Button variant='contained' sx={{margin:'2', borderRadius: 10}} color="warning">Sign-up</Button>
                </Box>
            </Toolbar>
        </AppBar>
    )
}

export default Header
